import React from "react";


function BottomMenu(props) {

    return (
        <div className="bottomMenu">
            <MapMenu bottomMenuItems={props.bottomMenuItems} />
        </div>
    )
}

function MapMenu(props) {
    return <div>{props.bottomMenuItems[0]}</div>
}

function CreateMenuItem(props) {
    <button className="button">nice</button>
}

export default BottomMenu;
